import styled from "styled-components";

export const GradientText = styled.h3`
  background: radial-gradient(circle, rgba(63,94,251,1) 0%, rgba(252,70,107,1) 100%);
  font-weight: bold;
  background-clip: text;
  -webkit-background-clip: text;
  color: transparent;
`;
